import './App.css';

function AppHome() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-logo"
          href="/"
          target="_self"
          rel="noopener noreferrer"
        >
          CodeTrackr
        </a>
      </header>
      <div className='App-home-content-cards'>
        <div className='App-home-card'>
          <h3>Ativos</h3>
        </div>
      </div>
    </div>
  );
}

export default AppHome;
